    def get_response(self, data):
        initial_post = self.api_client.post(self.submit_url, format='json', data=data)
        uuid = json.loads(initial_post.content)['run_uuid']
        response = json.loads(self.api_client.get(self.results_url.replace('<run_uuid>', str(uuid))).content)
        return response

    @skip("CHP test")
    def test_good_case(self):
        response = self.get_response(self.post)
        self.assertAlmostEqual(response['outputs']['Scenario']['Site']['year_one_emissions_lb_C02'], 7936414.5, -5)
        self.assertAlmostEqual(response['outputs']['Scenario']['Site']['year_one_emissions_bau_lb_C02'], 9194043.3, -5)
        self.assertAlmostEqual(response['outputs']['Scenario']['Site']['Generator']['year_one_emissions_lb_C02'], 203.3, -2)
        self.assertAlmostEqual(response['outputs']['Scenario']['Site']['Generator']['year_one_emissions_bau_lb_C02'], 0, -1)
        self.assertAlmostEqual(response['outputs']['Scenario']['Site']['CHP']['year_one_emissions_lb_C02'], 3722279.5, -5)
        self.assertAlmostEqual(response['outputs']['Scenario']['Site']['CHP']['year_one_emissions_bau_lb_C02'], 0.0, -1)
        self.assertAlmostEqual(response['outputs']['Scenario']['Site']['Boiler']['year_one_emissions_lb_C02'], 4452.7, -2)
        self.assertAlmostEqual(response['outputs']['Scenario']['Site']['Boiler']['year_one_emissions_bau_lb_C02'], 1431068.1, -5)
        self.assertAlmostEqual(response['outputs']['Scenario']['Site']['ElectricTariff']['year_one_emissions_lb_C02'], 4209479.0, -5)
        self.assertAlmostEqual(response['outputs']['Scenario']['Site']['ElectricTariff']['year_one_emissions_bau_lb_C02'], 7762975.2, -5)

    def test_too_far_case(self):
        self.post['Scenario']['Site']['latitude'] = 25
        self.post['Scenario']['Site']['longitude'] = -152
        response = self.get_response(self.post)
        self.assertTrue(response['outputs']['Scenario']['Site']['year_one_emissions_lb_C02'] is None)
        self.assertTrue("Your site location (-152.0,25.0) is more than 5 miles from the nearest emission region. Cannot calculate emissions." in response['messages']['warnings'] )
        
    def test_lookup(self):
        initial_post = self.api_client.get('/v1/emissions_profile/', format='json', data={'latitude':45,'longitude':-110})
        response = json.loads(initial_post.content)
        self.assertEqual(response['region'],'Northwest')

        initial_post = self.api_client.get('/v1/emissions_profile/', format='json', data={'latitude':65,'longitude':-152})
        response = json.loads(initial_post.content)
        self.assertEqual(response['region'],'Alaska')

        initial_post = self.api_client.get('/v1/emissions_profile/', format='json', data={'latitude':25,'longitude':-152})
        response = json.loads(initial_post.content)
        self.assertEqual(response['Error'],'Your site location (-152.0,25.0) is more than 5 miles from the nearest emission region. Cannot calculate emissions.')
